import React from 'react';
import { HashRouter as Router, Route, Routes ,Navigate } from 'react-router-dom';

import Dashboard from './dashboard/main_dashboard';
 import User from './user/main_user';
import Profile from './customer/main_customer';
import Indexmain from './indexmain';
// import Education from './education';


function App() {
  return (
    <Router>
      <Indexmain/>
      <Routes>
        <Route path="/" element={<Navigate to="/main_dashboard" />} />
        <Route path="/main_dashboard" element={<Dashboard />} />
        <Route path="/main_user" element={<User />} />

      </Routes>
    </Router>
  );
}

export default App;
